import React from 'react'
import { DeleteForever } from '@material-ui/icons';
import { IconButton } from '@material-ui/core';
import "./sidebar.css"


const FriendsList = ({friendsArr, onDelete}) => {

    return (
            <ul className="sidebarFriendList">    

                {friendsArr.map(element => (
                    <li className="sidebarFriend" id={element.id}>
                        <img className="sidebarFriendImg" src="/assets/profile_pic_2.jpg" alt=""/>
                        <span className="sidebarFriendName">{element.username}</span>
                        <IconButton className="sidebarFollowListUnfollow">
                            <DeleteForever onClick={onDelete} />
                        </IconButton>
                    </li>))}     
            </ul>

        )

}

export default FriendsList
